import logo from './logo.svg';
import './App.css';
import './Components/FreeText'
import FreeText from './Components/FreeText';
import PersonalSkills from './Components/PersonalSkills'
import TechnicalSkills from './Components/TechnicalSkills'
import Awards from './Components/Awards'
import PersonalData from './Components/PersonalData'



function App() {
  const personal_skills = ["Client Relationship Management", "Conflict Management", "Team Management", "Implementation Technique",
"Research & Development", "Log Analysis", "Collaboration", "Delegation", "Goal Setting", "Group Leadership", "Planning & Organizing",
"Time Bound"]
  const technical_skills = ["iOS", "Swift", "Javascript", "ReactJS", "Andriod", "HTML", "CSS", "Bootstrap", "C#", "C", "C++", "Python",
     "IoT", "Git", "Core JAVA", "Jenkins", "Jira", "MVVM", "MVC", "Agile", "Xcode", "Android Studio", "Data Structures",
    "GraphQL", "Power BI"]
  return (
    <div className="App">
      <div className='left-container'>
        <FreeText/>
        <PersonalSkills skills = {personal_skills}/>
        <TechnicalSkills skills = {technical_skills}/>
        <Awards></Awards>
      </div>
      <div className='right-container'>
        <PersonalData/>
      </div>
    </div>
  );
}

export default App;
